import { BrowserRouter, Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Sidebar from './defultComponent/sidebar';
import RouterA from './defultComponent/router';
import { ProSidebar } from 'react-pro-sidebar';

export default function App() {
  return (
      // <ProSidebar>
      //   <Sidebar />
      // </ProSidebar>
      <BrowserRouter>
        <Router>
          <Routes>
            <Route path='/' />
            <Route path='/menu' />
